appControllers.controller('dianpu-icecream-combo', function($scope,my,$state) {
	$scope.title = "冰激凌套餐预约";
    $scope.shopName =shopInfo.shopBo.shopName;
    $scope.address =shopInfo.shopBo.address;
    $scope.shopTel=shopInfo.shopBo.shopTel;
    $scope.isNoShowHeader=false;
    $scope.ifShowHint=false;
    $scope.share=function(){
        //console.log("分享");
        $scope.url= "http://z.haoma.cn/tms-app-war/preOrderApp/toIcePage?username="+userBo.userName;
        //console.log($scope.url);
        cordova.plugins.sharePlugin.share({
            title:"冰激凌套餐预约",
            description:"流量通话不限量，免预存月费5折",
            image:"",
            url:$scope.url,
            category:"2"
        });
    }

     $scope.subscribe=function(){
        $scope.isNoShowHeader=true;
        $scope.ifShowHint=true;
    }
    $scope.backClick=function(){
        $scope.isNoShowHeader=false;
        $scope.ifShowHint=false;
    }
    $scope.nextClick=function(){
        $state.go("dianpu-dw-fill-info",{"num":2});
    }
})